	return (
		<Container>
			<Col md={4}>
				<Image 
					src={device.img}
					style={{
						width: '100%',
						height: '500px',
						objectFit: 'cover',
						borderTopLeftRadius: '10px',
						borderTopRightRadius: '10px'
					}}
				/>
			</Col>
